import Document, { Head, Main, NextScript } from 'next/document';

export default class extends Document {
  render () {
    return (
      <html>
        <Head />
        <body>
          <Main />
          {/* here we will mount our video portal */}
          <div id='video' />
          <NextScript />
        </body>
      </html>
    )
  }
}
